import '../index.css';
import NextCard from '../components/Card/NextCard';
import { motion, AnimatePresence, animate } from 'framer-motion';
import { useState, useEffect } from 'react';

const projectsCards = [
  {
    subtitle: "Machine learning",
    title: "Predicting Functionality of Water Pumps",
    image:"assets/Images/CardImages/machine learning.jpeg",
    page: "/DataScience",
  } ,
  {
    subtitle: "App development",
    title: "Running Tracker",
    image: "assets/Images/CardImages/Running.jpeg",
    page: "/RunningTracker",
  } ,
  {
    subtitle: "Computer Vision",
    title: "Image Classification & Segmentation",
    image: "assets/Images/CardImages/ConvolutionalNeuralNetwork.jpg",
    page: "/ComputerVision",
  }
]

const fadeInAnimationVariants = {
  initial: {
    opacity: 0,
    y: 200,
  },
  animate: () => ({
    opacity: 1,
    y: 0,
  })
}

export default function Projects() {
  return (
    <motion.main
      initial={{ x: 1000, opacity: 0.3 }}
      animate={{ x: 0, opacity: 1 }}
      exit={{ x: 500, opacity: 0 }}
      transition={{ 
        type:"tween",
        stiffness: 160,
        duration: 0.5, 
    }}
    >
      <section class="pt-20 bg-gray-true-100 min-h-screen">

          <div class="text-center">
            <p class="font-semibold text-3xl mb-1">Projects Portfolio</p>
          </div>

          <div class="text-center">
              <p class="font-medium text-xl text-gray-800 mb-1 px-4">
                  Welcome to my University Projects Portfolio!  <br />
                  This page serves as a gallery of the remarkable work accomplished during my time at university. 
                  These projects reflect not only the knowledge gained but also the dedication and creativity poured into each endeavor. 
                  From research papers to group assignments and personal innovations, this portfolio encapsulates the essence of academic growth and problem-solving. 
                  Feel free to browse through these projects for inspiration or insight into my academic journey.
              </p>
          </div>

          <div className="w-full my-7 gap-4 grid grid-cols-1 md:flex-wrap md:flex justify-center items-center">
            {projectsCards.map((card, index) => (
                <motion.div 
                  className="w-1/2 sm:w-2/5 md:w-1/4 lg:w-1/5 mx-auto md:mx-0"
                  key={index} 
                  variants={fadeInAnimationVariants} 
                  initial="initial"
                  whileInView="animate"
                  viewport={{
                    once: true,
                  }}
                  custom={index}
                >
                  <NextCard 
                    subtitle={card.subtitle}
                    title={card.title}
                    image={card.image}
                    page={card.page}
                  />
                </motion.div>
            ))}
            {/* 
            <div className="w-1/2 sm:w-2/5 md:w-1/4 lg:w-1/5 mx-auto md:mx-0">
              <NextCard 
                subtitle="Machine learning"
                title="Predicting Functionality of Water Pumps"
                image="assets/Images/CardImages/machine learning.jpeg"
                page="/DataScience"/>
            </div>

            <div className="w-1/2 sm:w-2/5 md:w-1/4 lg:w-1/5 mx-auto md:mx-0">
              <NextCard 
                subtitle="App development"
                title="Running Tracker"
                image="assets/Images/CardImages/Running.jpeg"
                page="/RunningTracker"/>
            </div>

            <div className="w-1/2 sm:w-2/5 md:w-1/4 lg:w-1/5 mx-auto md:mx-0">
              <NextCard 
                subtitle="Computer Vision"
                title="Image Classification & Segmentation"
                image="assets/Images/CardImages/ConvolutionalNeuralNetwork.jpg"
                page="/ComputerVision"/>
            </div> */}

          </div>  

        </section>

      </motion.main>

  );
}

function Delay({delay}) {
    const [done, setDone] = useState(false)

    useEffect(() => {
      const showTimer = setTimeout(() => setDone(true), delay)
      return () => clearTimeout(showTimer)
    })

    return done;

}
